<!DOCTYPE html>
<html>
<head>

<meta charset="utf-8">
<meta name="viewport" content="initial-scale=1.0, user-scalable=no, width=device-width" />
$b4w_meta

<style type="text/css">
$styles
</style>

<script type="text/javascript" id="built_in_scripts">
$scripts;
b4w.module["built_in_data"] = function(exports, require) {exports["data"] = $built_in_data}
</script>

</head>
<body>
    <div id="main_canvas_container"></div>
    <div id="closed_button"></div>
    <div id="control_panel">
        <div id="buttons_container">
            <div id="fullscreen_on_button" class="control_panel_button"></div>
            <div id="auto_rotate_on_button" class="control_panel_button"></div>
            <div id="low_mode_display" class="control_panel_button active_quality_mode"></div>
            <div id="quality_buttons_container">
                <div id="ultra_mode_button" class="control_panel_button"></div>
                <div id="high_mode_button" class="control_panel_button"></div>
                <div id="low_mode_button" class="control_panel_button"></div>
            </div>
            <div id="sound_on_button" class="control_panel_button"></div>
            <div id="pause_button" class="control_panel_button"></div>
        </div>
        <a target="_blank" href="http://www.blend4web.com">
            <div id="logo_container"></div>
        </a>
    </div>
    <div id="opened_button"></div>
</body>
</html>
